import React, { Component } from 'react'
import Ninja from './Ninja';

class AppF extends Component {
  render() {
    state={
      nin
    }
    return (
      <div>
        <Ninja
          name='mostafa'
          age='34'
        />
        <Ninja
          name='rohy'
          age='32'
        />
      </div>
    )
  }
}
export default AppF;
